(1, 'Single Jod', 'Cultural', 'Music', 'Solo classical/jugal style performance', '- Solo performance only.\\n- Any classical or semi-classical composition permitted.\\n- Maximum time: 8 minutes.\\n- Bring your own tanpura/track/instrument if required.', '5000', '2500', 'music: 9111222333', 'coord: 9444555666', 'https://media.ipassio.com/media/ckeditor_image/2025/06/25/indian-classical-music.jpg', '2025-11-08 22:00:01', 'solo', NULL, NULL),
(2, 'Western Vocal', 'Cultural', 'Music', 'Solo western vocal performance', '- Solo performance only.\\n- Any western genre permitted.\\n- Maximum time: 5 minutes.\\n- Backing track allowed (bring on USB).', '4500', '2200', 'vocal: 9777888999', 'coord: 9666777888', 'https://adaminischool.com/wp-content/uploads/2021/03/Western-Vocal-Music-Classes-WEB.jpg', '2025-11-08 22:00:01', 'solo', NULL, NULL),
(3, 'Instrumental', 'Cultural', 'Music', 'Solo instrumental performance', '- Any instrument allowed.\\n- Maximum time: 6 minutes.\\n- Participant must bring their own instrument.\\n- Basic amplification provided.', '5000', '2500', 'inst: 9000111222', 'coord: 9333444555', 'https://img.freepik.com/premium-photo/instrument-wood-background_127069-48.jpg?semt=ais_hybrid&w=740&q=80', '2025-11-08 22:00:01', 'solo', NULL, NULL),
(4, 'Duet Performance', 'Cultural', 'Music', 'Duet vocal or instrumental performance', '- Team of 2 participants.\\n- Any genre (vocal/instrumental) permitted.\\n- Maximum time: 6 minutes.\\n- Own instruments/tracks required.', '5500', '2800', 'duet: 9222333444', 'coord: 9555666777', 'https://previews.123rf.com/images/otnaydur/otnaydur1305/otnaydur130500018/19428477-two-people-a-couple-playing-duet-musical-performance-with-two-grand-pianos.jpg', '2025-11-08 22:00:01', 'team', 2, 0),
(5, 'Bharatanatyam', 'Cultural', 'Dance', 'Classical Bharatanatyam solo performance', '- Solo performance only.\\n- Any classical Bharatanatyam composition permitted.\\n- Maximum time: 8 minutes.\\n- Traditional costume mandatory.\\n- Track to be provided by participant (USB).', '4500', '2200', 'dance: 9123001122', 'coord: 9822212456', 'https://cdn.dollsofindia.com/images/p/woven-bamboo-blinds/bharatnatyam-dancer-wall-hanging-HF82_l.jpg', '2025-11-08 22:00:01', 'solo', NULL, NULL),
(6, 'Westen Dance', 'Cultural', 'Dance', 'Contemporary/Western dance performance', '- Solo or duo permitted.\\n- Any western dance form allowed.\\n- Maximum time: 7 minutes.\\n- Appropriate costume required.\\n- Bring your own track.', '4000', '2000', 'john: 9988776655', 'mary: 9988774455', 'https://img.freepik.com/free-vector/hand-drawn-dancing-cowboy-silhouette_23-2151156792.jpg?semt=ais_hybrid&w=740&q=80', '2025-11-08 22:00:01', 'solo_team', 2, 0),
(7, 'Folk Dance', 'Cultural', 'Dance', 'Traditional folk dance performance', '- Solo or group performance allowed.\\n- Any traditional folk style permitted.\\n- Maximum time: 10 minutes.\\n- Traditional attire preferred.\\n- Own music arrangement required.', '5000', '2500', 'contact1: 9123456789', 'contact2: 9876543210', 'https://kalyanikalamandir.com/wp-content/uploads/2023/09/104.jpg', '2025-11-08 22:00:01', 'solo_team', 6, 4),
(8, 'Group Dance', 'Cultural', 'Dance', 'Group dance performance', '- Team size: 6-16 members.\\n- Any genre allowed.\\n- Maximum time: 8 minutes (including setup).\\n- Props allowed (safe only).\\n- Track must be submitted beforehand.', '7000', '3500', 'lead: 9001112223', 'coord: 9334445556', 'https://images.pexels.com/photos/690597/pexels-photo-690597.jpeg?cs=srgb&dl=pexels-redhaste-690597.jpg&fm=jpg', '2025-11-08 22:00:01', 'team', 6, 4),
(9, 'MonoCasting', 'Cultural', 'Dramatics', 'Solo dramatic monologue performance', '- Solo performance only.\\n- Maximum time: 5 minutes.\\n- Props allowed (handheld).\\n- No vulgar/offensive content.', '4000', '2000', 'drama1: 9888999000', 'drama2: 9111222333', 'https://thevintagejohnite.wordpress.com/wp-content/uploads/2016/06/drama-312318_960_720.png', '2025-11-08 22:00:01', 'solo', NULL, NULL),
(10, 'Drama', 'Cultural', 'Dramatics', 'Short drama/skit', '- Team size: 6-12 members.\\n- Maximum time: 12 minutes.\\n- Any theme allowed.\\n- Basic props permissible.', '7000', '3500', 'drama3: 9222333444', 'drama4: 9555666777', 'https://images.picxy.com/cache/2019/2/8/d5bd8f7e54bd208465db614f310bf0cc.jpg', '2025-11-08 22:00:01', 'team', 6, 4),
